import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {
    
    const[testList, setTestList] = useState();

    useEffect(() => {
        const listTest = async () => {
            const listTestResponse = await client.entities.test.list();
            console.log(listTestResponse?.items);
            setTestList(listTestResponse?.items);
        }
        listTest();
    }, [])

    const filteredtestList = () => 
    {
        testList.filter(testList=> testList.Device.includes('Device1'))
    }

    /*
    {names.filter(name => name.includes('J')).map(filteredName => (
        <li>
          {filteredName}
        </li>
      ))}
    */
    return(
        
        <div className="DevicePage">
            <h1> Device 1 </h1>

            <div>
                {filteredtestList?.map((item, index) => (
                    <li key={index}>   
                    {item.Device}
                    </li>
                ))}
            </div>

        </div>

    )
}
